import React from 'react';

type paginationProps = {
    pages: number[];
};

const Pagination: React.FC<paginationProps> = (props) => {
    return <React.Fragment>
            this.props.pages.map((page, i) => {
         <button key={i}>{props.pages}</button>
    }
        </React.Fragment>
};

export default Pagination;
